import React from "react";
import "./dropDown.css";

const Dropdown = (props) => {

  return (
    <>
      <div className="d-flex col-12 flex-col dropDownList">
        <ul className="flex flex-col">
          <li>Edit</li>
          <li>Delete</li>
        </ul>
      </div>
    </>
  );
};

export default Dropdown;
